def overlay_blend_8(base: List[List[int]], active: List[List[int]]) -> List[List[int]]:
    return matrix_where(
        base,
        base,
        lambda x, y: ite(
            x >= 128,
            2 * x + x - (2 * x * x) // 255 - 255,
            (2 * x * x) // 255
        )
    )
